import React, {Component} from 'react';
import PageMenu from "../../components/pageMenu/pageMenu";
import classes from "./CallBoard.css";
import BoardCard from "../../components/boardCard/BboardCard";

class CallBoard extends Component {

    state = {
        boardCard: [
            {file: null, note: null, persone: null}
        ]
    }

    render() {
        return (
            <div className={classes.callBoard}>
                <PageMenu/>
                <h1>Доска обьявлений</h1>
                <div className={classes.boardHolder}>
                    <BoardCard file={this.state.boardCard.file} note={this.state.boardCard.note} persone={this.state.boardCard.persone}/>
                </div>
            </div>
        );
    }
}

export default CallBoard;
